import { Link } from 'react-router-dom';

const StartPage = () => {
    const nextpage = () => {
        return (<Link to='/game' className="btn"></Link>)
    }

    return (
        <section className="home">
            <div>
                <h1>Are We There, Yeti?</h1>
                <button onClick={() => {nextpage}}>Start Game</button>
            </div>
        </section>
    )
}

export default StartPage;
